import './App.css';

function Shop() {
  useEffect(() => {
    fetchitems();
  },[]);
  const [bt, setItems] = useState([]);
  const fetchitems = async () => {
    const issam = await fetch(
      'https://fortnite-api.theapinetwork.com/upcoming/get'
      );
      const bt = await issam.json();
      console.log(bt.data);
      setItems(bt.data);

  }
  return (
    <div>
      {bt.map(item => (
        <h1>{item.name}</h1>
      ))}
    </div>
  );
}

export default Shop;
